## Remarks  
 <span data-ttu-id="88e42-102">O <xref:System.ServiceModel.Configuration.WebHttpElement> é um <xref:System.ServiceModel.Configuration.BehaviorExtensionElement> subtipo que pode ser usado para incluir o <xref:System.ServiceModel.Description.WebHttpBehavior> em um ponto de extremidade por meio da configuração.</span><span class="sxs-lookup"><span data-stu-id="88e42-102">The <xref:System.ServiceModel.Configuration.WebHttpElement> is a <xref:System.ServiceModel.Configuration.BehaviorExtensionElement> sub-type that can be used to include the <xref:System.ServiceModel.Description.WebHttpBehavior> on an endpoint through configuration.</span></span> <span data-ttu-id="88e42-103">O <xref:System.ServiceModel.Description.WebHttpBehavior> comportamento, quando usado em conjunto com o <xref:System.ServiceModel.WebHttpBinding> de associação, permite que o modelo de programação da Web para um serviço do Windows Communication Foundation (WCF).</span><span class="sxs-lookup"><span data-stu-id="88e42-103">The <xref:System.ServiceModel.Description.WebHttpBehavior> behavior, when used in conjunction with the <xref:System.ServiceModel.WebHttpBinding> binding, enables the Web programming model for a Windows Communication Foundation (WCF) service.</span></span> <span data-ttu-id="88e42-104">Observe que o <xref:System.ServiceModel.Web.WebServiceHost> adiciona automaticamente esse comportamento para pontos de extremidade que usam o <xref:System.ServiceModel.WebHttpBinding>.</span><span class="sxs-lookup"><span data-stu-id="88e42-104">Note that the <xref:System.ServiceModel.Web.WebServiceHost> automatically adds this behavior to endpoints that use the <xref:System.ServiceModel.WebHttpBinding>.</span></span>  
  
   
  
## Examples  
 <span data-ttu-id="88e42-105">Este exemplo retorna o tipo <xref:System.ServiceModel.Configuration.WebHttpElement>.</span><span class="sxs-lookup"><span data-stu-id="88e42-105">This sample returns the type <xref:System.ServiceModel.Configuration.WebHttpElement>.</span></span>  
  
```  
using System;  
using System.ServiceModel;  
using System.ServiceModel.Web;  
using System.ServiceModel.Configuration;  
  
    class Program  
    {  
        static void Main(string[] args)  
        {  
            WebHttpElement webHttpElement = new WebHttpElement();  
            Console.WriteLine("The type is: {0}", webHttpElement.BehaviorType);  
            Console.WriteLine("Press <ENTER> to terminate the program.");  
            Console.ReadLine();  
        }  
    }  
```

  
  
